    fetch('http://localhost:5000/api/notes/me', {
      method: 'GET',
      credentials: 'include', // âœ… Send cookies!
    })
      .then(res => res.json())
      .then(setNotes)
      .catch((err) => console.error('Failed to fetch notes:', err));
  }, []);

  return (
    <div style={{ padding: '2rem' }}>
